/**
*	Event mapping class for adding custom tab to 
*	without modifying the Profile nav collection.
*	@version 2020-02-20			
*	@author		Francis Mawelle
**/

import PT_RCF:ServiceInterface; /* Required for event mapping */
import FM_SCC_PROFILE_FL:ProfileGrouplet; /* The class with our logic */
import SCC_PROFILE_FL:COMPONENTS:SCC_PROFILE_FL;

class SCC_PROFILE_SP_FL_PostBuild implements PT_RCF:ServiceInterface
   method execute(); /* Required for event mapping */
end-class;

/* The component variable declared in the Profile component - as delivered */
Component SCC_PROFILE_FL:COMPONENTS:SCC_PROFILE_FL &ObjCH;

method execute
   /+ Extends/implements PT_RCF:ServiceInterface.execute +/
   /* Point the component variable to our custom subclass */
   &ObjCH = create FM_SCC_PROFILE_FL:ProfileGrouplet();

   &ObjCH.SCC_PROFILE_FL_PostBuild();
end-method;

/**
*	Add Custom Navigation tabs  to 
*	navigation without modifying the nav collection.
*	@version 2020-02-20			
*	@author		Francis Mawelle
**/
import SCC_FLUID:MODEL:Navigation;
import SCC_FLUID:MODEL:NavigationTab;
import SCC_FLUID:UTIL:Constants;

class NavigationTab
   method NavigationTab();
   method AddCustomTab(&Navigation As SCC_FLUID:MODEL:Navigation);
   method setInitialTabSelected(&Navigation As SCC_FLUID:MODEL:Navigation);

private
   instance SCC_FLUID:UTIL:Constants &FluidConstants;
   instance string &sInitialTab;
   instance SCC_FLUID:MODEL:NavigationTab &objComponentUrlTab, &objCustomUrlTab;
end-class;

/*Constructor Method*/
method NavigationTab
   &sInitialTab = Page.FM_ALLIANCE_DEMO
end-method;

/***
	*	Add new tab(s) to the navigation object
	*	@param &Navigation Fluid Navigation object
	*	@return none
***/
method AddCustomTab
   /+ &Navigation as SCC_FLUID:MODEL:Navigation +/
   &objComponentUrlTab = create SCC_FLUID:MODEL:NavigationTab();
   &objCustomUrlTab = create SCC_FLUID:MODEL:NavigationTab();
   &FluidConstants = create SCC_FLUID:UTIL:Constants();

   /* Set properties for the New Tab */
   /* For ComponentURL */
   &objComponentUrlTab.Label = "Demo Works";
   &objComponentUrlTab.ImageName = Image.FM_LAMP;
   &objComponentUrlTab.TabID = &sInitialTab;
   &objComponentUrlTab.Transfer.CREFName = "FM_ALLIANCE_DEMO_GBL";
   /* change this value if you'd like a different behavior than the default  which opens in current frame  */
   rem &objComponentUrlTab.NewWindow = False;
   /* You can change this so that you nest additional tabs under a different (folder) tab  */
   rem &objComponentUrlTab.HasSubTabs = True;
   &objComponentUrlTab.Transfer.Type = &FluidConstants.ComponentURL;
   &objComponentUrlTab.Transfer.MenuName = "SCC_PROFILE_FL";
   &objComponentUrlTab.Transfer.PanelGroupName = "FM_ALLIANCE_DEMO";
   &objComponentUrlTab.Transfer.PanelName = "FM_ALLIANCE_DEMO";
   &objComponentUrlTab.Transfer.MenuAction = %Action_UpdateDisplay;

   /* For CustomURL -   By design, this will always open in a new window */
   /* If the HasSubTabs property is set to true, you can make this a sub tab */
   rem &objCustomUrlTab.ParentTabID = Page.FM_ALLIANCE_DEMO;
   &objCustomUrlTab.Label = "Alliance Conference";
   &objCustomUrlTab.TabID = "ALLIANCE_CONFERENCE";
   &objCustomUrlTab.Transfer.Type = &FluidConstants.CustomURL;
   &objCustomUrlTab.Transfer.TransferURL = "https://www.alliance-conference.com/";
   &objCustomUrlTab.ImageName = Image.FM_NOTEPAD;


   If All(&Navigation) Then
      &Navigation.AddTab(&objComponentUrlTab);
      &Navigation.AddTab(&objCustomUrlTab);
   End-If;
end-method;

/***
	*  Set which tab is displayed on the detail side of the start page
	*  @param &initialTab TabId 
	*	@return none
***/
method setInitialTabSelected
   /+ &Navigation as SCC_FLUID:MODEL:Navigation +/
   &Navigation.SelectMDTab(&sInitialTab); /*set initial tab selected*/
end-method

/**
*	Extend delivered  SCC_PROFILE_FL class to enable
*	adding Custom Navigation tabs  dynamically 
*	without modifying the nav collection.
*	@version 2020-02-20			
*	@author		Francis Mawelle
**/

import FM_SCC_PROFILE_FL:NavigationTab;
import SCC_FLUID:MODEL:Navigation;
import SCC_PROFILE_FL:COMPONENTS:SCC_PROFILE_FL;

class ProfileGrouplet extends SCC_PROFILE_FL:COMPONENTS:SCC_PROFILE_FL
   /* extended from the super class */
   method SCC_PROFILE_FL_PostBuild();
   method BuildNavigation();
end-class;

method SCC_PROFILE_FL_PostBuild
   /+ Extends/implements SCC_PROFILE_FL:COMPONENTS:SCC_PROFILE_FL.SCC_PROFILE_FL_PostBuild +/

   /* Execute the PostBuild  - we are not changing anything here */
   %Super.SCC_PROFILE_FL_PostBuild();
end-method;

method BuildNavigation
   /+ Extends/implements SCC_FLUID:MODEL:Component.BuildNavigation +/
   Local FM_SCC_PROFILE_FL:NavigationTab &objNavTab;
   &objNavTab = create FM_SCC_PROFILE_FL:NavigationTab();

   /* Execute any code that is associated with this method in the super class  */
   %Super.BuildNavigation();

   /* Then execute our code to add the custom navigation  */
   /*  Or call our methods prior to the super class BuildNavigation method if you want your custom tabs on top */
   &objNavTab.AddCustomTab(%Super.Navigation);
   &objNavTab.setInitialTabSelected(%Super.Navigation);
end-method;
